import Typing from 'react-typing-animation'

const Index = () => (
    <div className='header'>
        <Typing>
            <div>
                <Typing.Delay ms={500} />
                <span className='bio'>
                    For CS students, by CS students.
            </span>
            </div>

        </Typing>

        <style jsx>{`
        .header {
            font-size: 40px;
            font-weight: 700;
            line-height: 1.2;
            color: #486491;
            margin: 20px auto;
            font-family: 'Arial';
        }
      `}</style>
    </div>
);

export default Index;
